                <p className='span_one'>Burke Developing is a registered home improvement company located in Quincy Massachusetts</p>
                <style jsx>{`
                    #mybody {
                        float: left;
                        min-height: 800px;
                    }
                    .span_one {
                        float: left;
                        width: 100%;

                    }
                `}</style>
            </div>
        </div>
    )
}

export default Index
